import { THEME } from '@common/constants/theme.constant';
import React from 'react';
import { css } from 'twin.macro';

interface IProps {
    leftChild: JSX.Element;
    rightChild: JSX.Element;
}

export const StorybookPreview = ({ leftChild, rightChild }: IProps): JSX.Element => {
    return (
        <div>
            <div tw="grid grid-cols-2 grid-column-gap[16px]">
                <div>
                    <h3>Example:</h3>
                </div>

                <div>
                    <h3>JSON:</h3>
                </div>
            </div>
            <div tw="grid grid-cols-2 grid-column-gap[16px]">
                <div css={styles.panel}>{leftChild}</div>

                <div css={styles.panel}>{rightChild}</div>
            </div>
        </div>
    );
};

const styles = {
    panel: css`
        border: 1px solid ${THEME.GRAY};
        padding: 16px;
        min-height: 100px;
    `,
};
